{'type': '/type/text', 'value': 'Carole Mortimer was born on 1960 in a village in England that she claims was so small that "if you blinked as you drove through it you could miss seeing it completely!" She was the youngest of three children, and she adds that her parents still live in the house where she first came into the world, and her two brothers live very close by. 

Carole's early ambition to become a nurse came to an abrupt end after only one year of training due to a weakness in her back, suffered in the aftermath of a fall. Instead, she went on to work in the computer department of a well-known stationery company. During her time there, Carole made her first attempt at writing a novel for Mills and Boon. "The manuscript was far too short and the plotline not up to standard, so I naturally received a rejection slip," she says. "Not taking rejection well, I went off in a sulk for two years before deciding to 'have another go.'" Her second manuscript was accepted, beginning a long and fruitful career. Her strong, traditional romances, with their distinct style, brilliantly developed characters and romantic plot twists, have earned her an enthusiastic audience worldwide. Since the publication of her first novel in 1978, this British writer has shown no signs of slowing her pace. In fact, when over 20 years later she celebrated the publication of her 100th book She says: "I have enjoyed every moment of my career! I really do enjoy my writing, and have every intention of continuing to do so for another 20 years!" 

Carole married to Peter, father to two sons, they had four sons more, and now the family is formed by six sons: Matthew, Joshua, Timothy, Michael, David and Peter Jr. (with 22 years of difference between the first-born and the unexpected youngest child). She says: "I'm happily married to Peter senior; we’re best friends as well as lovers, which is probably the best recipe for a successful relationship. We live in a lovely part of England." Theyt also live with a menagerie of pets, including a dog acquired several years ago in Canada, which is actually half-coyote!'}

{'type': '/type/text', 'value': 'Miranda Lee was born at Port Macquarie, a popular seaside town on the Mid-North Coast of New South Wales, Australia, and is the youngest of four children. Her father was a country school teacher and brilliant sportsman. Her mother was a talented dressmaker. When Miranda was ten, her father was transferred to Gosford, another coastal town in the countryside, much closer to Sydney. After leaving her convent school, Miranda briefly studied the cello before moving to Sydney, where she embraced the emerging world of computers.

Her career as a programmer ended after she married, had three daughters and bought a small acreage in a semi-rural community. Following this, she attempted greyhound training, as well as horse and goat breeding, but was left dissatisfied. Miranda yearned to find a creative career from which she could earn money. When her sister suggested writing romances, it seemed like a good idea. She could do it at home, and it might even be fun! It took a decade of trial and error before her first romance, After the Affair, was accepted and published. At that time, Miranda, her husband, and her three daughters had moved back to the Central Coast, where they could enjoy the sun and the surf lifestyle once again.

Not long into her writing career, Miranda committed herself to writing a six-book series entitled, The Hearts of Fire, with a deadline of just nine short months. Bravely, her husband left his executive position to stay home and support Miranda’s writing career. He learned to cook and to clean, two invaluable household skills. Numerous successful stories followed, each embodying Miranda’s trademark style: pacy and sexy rhythms; passionate, real-life characters; and enduring, memorable story lines. She has one credo when writing romances: Don’t bore the reader! Millions of fans world-wide agree she never does.'}

